import logo from '../../logo.svg';
import Contact from '../ContactUs/Contact';
import Home from '../Home/Home';
import Login from '../Login/Login';
import Navbar from '../Navbar/Navbar';
import Register from '../Register/Register';
import './App.css';

function App() {
  return (
    <div className="App">
       <Navbar/>
       <Home/>
       <Login/>
       <Register/>
       <Contact/>




    </div>
  );
}

export default App;
